INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (15137, 0, 'Parathyroid hormone', 'Hyperparathyroidism', 'Patients known to have an underlying hypercalcemic disorder, such as primary hyperparathyroidism, should not be treated with parathyroid hormone and its analogs because of the risk of exacerbating hypercalcemia.', '3', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (15138, 0, 'Parathyroid hormone', 'Neoplasms', 'Parathyroid hormone and its analogs should not be used in patients who are at increased baseline risk for osteosarcoma.  These agents should only be used if the potential benefits are considered to outweigh the potential risks.  Monitor these patients according to clinical guidelines.  Patients with bone metastases or a history of skeletal malignancies should not be treated with these agents.', '3', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (15139, 0, 'Parathyroid hormone', 'Kidney Diseases', 'Parathyroid hormone is eliminated by the kidney and maximum drug levels increased with renal impairment.  No dose adjustment is recommended in patients with mild to moderate renal impairment.  No studies have been conducted in patients with severe renal impairment or in renal impairment patients on dialysis.  Care and close monitoring should be exercised when using this agent in patients with severe renal impairment or on dialysis.', '2', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (15140, 9657, 'Paroxetine', 'Depressive Disorder', 'Adult and pediatric patients with depression and other psychiatric disorders may experience worsening of their symptoms and may have the emergence of suicidal thoughts and behavior.  Patients should be monitored appropriately and observed closely for worsening of their symptoms, suicidality or changes in their behavior, especially during the first few months of treatment, and at times of dose changes.  Families and caregivers should be advised of the need for close observation and communication with the treating physician.  Discontinuing the medication should be considered if symptoms are persistently worse, or abrupt in onset.  It may be prudent to refrain from dispensing large quantities of medication to these patients.', '3', '', 'DDInter', 0);
