INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (15153, 9657, 'Paroxetine', 'Fractures, Bone', 'Some epidemiological studies have reported association between antidepressant treatment and bone fractures.  The extent of this risk is unknown.  Treatment with paroxetine should be administered with caution in patients with decreased bone mineral density that present unexplained bone pain, tenderness, swelling or bruising.', '2', '', 'DDInter', 0);
